Let the center of the inscribed circle be O, and let A, B, and C be the points where the circle is tangent to the quarter-circle, as shown below:

[asy]
unitsize(0.15 cm);

pair A, B, C, O;

A = (0,0);
B = (20,0);
C = (0,20);
O = (20 - 20*sqrt(2) + 20, 20 - 20*sqrt(2) + 20);

draw(A--B--C--cycle);
draw(O--A);
draw(O--B);
draw(O--C);
draw(Circle(O,abs(O - A)));

label("$A$", A, SW);
label("$B$", B, SE);
label("$C$", C, NW);
label("$O$", O, NE);
[/asy]

Since the circle is tangent to the quarter-circle at A and C, the angle AOC is a right angle. Let r be the radius of the inscribed circle. Then AO = r, OC = r, and AC = 20 - r. By the Pythagorean theorem, we have

$r^2 + r^2 = (20 - r)^2$.

Solving for r, we get $r = \boxed{20(\sqrt{2} - 1)}$.
